import React, { useState } from "react";
import axios, { Axios } from "axios";

axios.get("https://api.scryfall.com/sets")
    .then(res => {
        const sets = res.data;
        this.setState({ sets })
    })


const SetSelect  = () => {

    const [sets, setSetName] = useState()

    return(
        <div>
            <select>
                {sets.name}
            </select>
        </div>
    )
}

export default SetSelect
